import React, {useEffect, useState} from "react";
import Home from ''


function Test(){

    const [poems, setPoems] = useState([])
    useEffect(() => {
        fetch("http://localhost:3000/poems")
            .then(res => res.json())
            .then(data => setPoems(data))
    }, [])

    return(
        <div>
            <Home />
        </div>
    )
}

export default Test;
